contract BunyERC6551Registry is IERC6551Registry, Ownable {
    error InitializationFailed();
    uint256 public accountCounter = 0;
    mapping(address => IBunyAccount) public tokenBoundAccounts;
    address public calendarAddress;
    NftList[] public registeredNfts;


  event AccountCreated(
        address account,
        address implementation,
        uint256 chainId,
        address tokenContract,
        uint256 tokenId,
        uint256 salt,
        address calendarAddress,
        uint timestamp
    );

    
    struct IBunyAccount {
        address implementation;
        uint256 chainId;
        address tokenContract;
        uint256 tokenId;
        uint256 salt;
        address calendarAddress;
    }

    struct NftList {
        address tokenContract;
        uint256 tokenId;
        uint256 chainId;
    }

      constructor() {
    
    transferOwnership(msg.sender);
  }


    function createAccount(
        address implementation,
        uint256 chainId,
        address tokenContract,
        uint256 tokenId,
        uint256 salt,
        bytes calldata initData
    ) external returns (address) {
        bytes memory code = _creationCode(implementation, chainId, tokenContract, tokenId, salt);
        address _account = Create2.computeAddress(
            bytes32(salt),
            keccak256(code)
        );
        if (_account.code.length != 0) return _account;
        _account = Create2.deploy(0, bytes32(salt), code);
        if (initData.length != 0) {
            (bool success, ) = _account.call(initData);
            if (!success) revert InitializationFailed();
        }
        accountCounter++;
        registeredNfts.push(NftList(tokenContract, tokenId, chainId));
        tokenBoundAccounts[_account] = IBunyAccount(implementation, chainId, tokenContract, tokenId, salt, calendarAddress);
        emit AccountCreated(
            _account,
            implementation,
            chainId,
            tokenContract,
            tokenId,
            salt,
            calendarAddress,
            block.timestamp
        );
        return _account;
    }

     function getAllRegisteredNfts() external view returns (NftList[] memory) {
        return registeredNfts;
    }

    function account(
        address implementation,
        uint256 chainId,
        address tokenContract,
        uint256 tokenId,
        uint256 salt
    ) external view returns (address) {
        bytes32 bytecodeHash = keccak256(
            _creationCode(implementation, chainId, tokenContract, tokenId, salt)
        );
        return Create2.computeAddress(bytes32(salt), bytecodeHash);
    }

 function getAccountDetails(address accountAddress) public view returns (address,uint256,address,uint256,uint256,address) {
        IBunyAccount memory details = tokenBoundAccounts[accountAddress];
        return (details.implementation, details.chainId, details.tokenContract, details.tokenId, details.salt, details.calendarAddress);
    }

    function _creationCode(
        address implementation_,
        uint256 chainId_,
        address tokenContract_,
        uint256 tokenId_,
        uint256 salt_
    ) internal pure returns (bytes memory) {
        return
            abi.encodePacked(
