                implementation_,
                hex"5af43d82803e903d91602b57fd5bf3",
                abi.encode(salt_, chainId_, tokenContract_, tokenId_)
            );
    }

    function setCalendarAddress(address _contractAddress) public onlyOwner {
    calendarAddress = _contractAddress;
  }
}
